import { BrowserRouter as Router } from 'react-router-dom';

// import Navigation from './components/Navbar';
import Routes from './Routes';


ReactDOM.render(<Router>
    <div className="Test">
        <Routes />
    </div>
</Router>, <App />, document.getElementById("root"));
